import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../css/header/dropdown.css'

const DropDown = () => {

    const [showMenu1, setShowMenu1] = useState(false);
    const [showMenu2, setShowMenu2] = useState(false);
    const [showMenu3, setShowMenu3] = useState(false);
    const [showMenu4, setShowMenu4] = useState(false);
    const [showMenu5, setShowMenu5] = useState(false);
    const [showMenu6, setShowMenu6] = useState(false);
    const [showMenu7, setShowMenu7] = useState(false);

    const handleMouseOver = (menuNumber) => {
        switch (menuNumber) {
            case 1:
                setShowMenu1(true);
              break;
            case 2:
                setShowMenu2(true);
              break;

            case 3:
                setShowMenu3(true);
              break;

            case 4:
                setShowMenu4(true);
              break;

            case 5:
                setShowMenu5(true);
              break;

            case 6:
                setShowMenu6(true);
              break;

            case 7:
                setShowMenu7(true);
              break;
          }
      };

      const handleMouseOut = (menuNumber) => {
        switch (menuNumber) {
            case 1:
                setShowMenu1(false);
              break;
            case 2:
                setShowMenu2(false);
              break;

            case 3:
                setShowMenu3(false);
              break;

            case 4:
                setShowMenu4(false);
              break;

            case 5:
                setShowMenu5(false);
              break;

            case 6:
                setShowMenu6(false);
              break;

            case 7:
                setShowMenu7(false);
              break;
          }
      };

      const handleMobileButtonClick = (menuNumber) => {
        switch (menuNumber) {
          case 1:
            setShowMenu1((prev) => !prev);
            break;
          case 2:
            setShowMenu2((prev) => !prev);
            break;
          case 3:
            setShowMenu3((prev) => !prev);
            break;
          case 4:
            setShowMenu3((prev) => !prev);
            break;
          case 5:
            setShowMenu3((prev) => !prev);
